import React, { useState } from "react";
import { DataGrid } from "@mui/x-data-grid";
import { makeStyles } from "@mui/styles";
import TextField from "@material-ui/core/TextField";

const columns = [
  { field: "id", headerName: "SI No", width: 120 },
  { field: "CustomerOrderID", headerName: "CUSTOMER ORDER ID", width: 240 },
  { field: "SalesOrg", headerName: "SALES ORG", type: "number", width: 160 },
  {
    field: "DistributionChannel",
    headerName: "DISTRIBUTION CHANNEL",
    width: 290,
  },
  {
    field: "ComapanyCode",
    headerName: "COMPANY CODE",
    type: "number",
    width: 200,
  },
  {
    field: "OrderCreationDate",
    headerName: "ORDER CREATION DATE",
    width: 250,
  },
  {
    field: "OrderAmount",
    headerName: "ORDER AMOUNT",
    type: "number",
    width: 200,
  },
  {
    field: "OrderCurrency",
    headerName: "ORDER CURRENCY",
    width: 220,
  },
  {
    field: "CustomerNumber",
    headerName: "CUSTOMER NUMBER",
    type: "number",
    width: 230,
  },
  {
    field: "AmountInUSD",
    headerName: "AMOUNT IN USD",
    type: "number",
    width: 200,
  },
];

const useStyles = makeStyles((theme) => ({
  container: {
    margin: "100px",
    padding: "1px",
    marginLeft: "12px",
    marginRight: "5px",
  },
}));

export default function SearchResult({ searchResult }) {
  const classes = useStyles();

  return (
    <div className={classes.container} style={{ height: 500, width: "1300px" }}>
      {searchResult.length > 0 ? (
        <DataGrid
          rows={searchResult}
          columns={columns}
          checkboxSelection={false}
          hideFooterSelectedRowCount
          scrollbarSize={10}
        />
      ) : (
        <p>No matching results found.</p>
      )}
    </div>
  );
}
